import React, { useState } from 'react';
import './userReg.css';
import axios from 'axios';

const UserReg = () => {
    const [message, setMessage] = useState('');
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        phone_number: '',
        password: '',
        confirmPassword: '',
        gender: '',
        InterestedAreas: ''
    });
    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        // Form data for the POST request
        const data = new FormData();
        data.append('fullName', formData.name);
        data.append('email', formData.email);
        data.append('phone', formData.phone_number);
        data.append('password', formData.password);
        data.append('confirmPassword', formData.confirmPassword);
        data.append('gender', formData.gender);
        data.append('about', formData.InterestedAreas);
        try {
            const response = await axios.post('http://localhost:5000/userReg', data);
            console.log(response.data); // Handle the response
            setMessage("Registration successful");
            setTimeout(() => {
                setMessage('');
            }, 2000);
        } catch (error) {
            console.error('There was an error uploading the data!', error);
        }
    };
    return (
        <>
            {message && <p>{message}</p>}
            <div className="body">
                <div className="wrapper">
                    <h1 className="title">User Registration</h1>

                    <form onSubmit={handleSubmit}>
                        <div className="info">
                            <div className="input-box">
                                <label >Full Name</label>
                                <input type="text" placeholder="Enter Full Name" onChange={handleChange} required />
                            </div>
                            <div className="input-box">
                                <label>Email Address</label>
                                <input type="email" placeholder="Enter Email Address" onChange={handleChange} required />
                            </div>
                            <div className="input-box">
                                <label>Phone Number</label>
                                <input type="text" placeholder="Enter Phone Number" onChange={handleChange} required />
                            </div>
                            <div className="input-box">
                                <label>Gender</label>
                                <select name="Female" onChange={handleChange} required>
                                    <option value="volvo">Female</option>
                                    <option value="saab">Male</option>
                                    <option value="mercedes">Others</option>
                                </select>
                            </div>
                            <div className="input-box">
                                <label>Password</label>
                                <input type="password" placeholder="Enter Password" onChange={handleChange} required />
                            </div>

                            <div className="input-box">
                                <label>Confirm Password</label>
                                <input type="password" placeholder="Confirm Password" onChange={handleChange} required />
                            </div>
                        </div>
                        <div className="input-box">
                            <label for="InterestedAreas">Interested Areas</label>
                            <textarea rows="4" cols="50" onChange={handleChange} required>
                            </textarea>
                        </div>
                        <div className="btn">
                            <input type="submit" value="Register" />
                        </div>
                    </form>
                </div>
            </div>

        </>
    )
}

export default UserReg;
